import React, { useState, useEffect } from "react";
import axios from "axios";
const Crew = () => {
  const [data, SetData] = useState([]);
  const FetchData = () => {
    axios.get("https://api.spacexdata.com/v4/crew").then((response) => {
      console.log(response.data);
    });
    useEffect(() => {
      FetchData();
    }, []);
  };
  return <div></div>;
};

export default Crew;
